        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-3958878945":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"exclamation\",\"color\":\"#5446d8\",\"hotspots\":[{\"position\":{\"x\":66.32373122575898,\"y\":30.8025009827044},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>En Ecuador, el cóndor andino está en peligro de extinción por la <strong>caza</strong>, la <strong>destrucción de su hábitat</strong> y la <strong>escasez de alimento</strong>. Como es un ave carroñera, depende de grandes extensiones naturales. Cuando estas zonas se reducen, el cóndor tiene menos espacio para vivir y reproducirse.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"bec1c20b-e84f-4798-a084-299080a29663\"}],\"header\":\"Ejemplo 1: El cóndor andino\"},{\"position\":{\"x\":43.11842715625737,\"y\":45.07670007861635},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Cuando los ríos se contaminan con <strong>basura, químicos o aguas residuales</strong>, muchas especies de peces mueren y otras deben migrar para sobrevivir. Esto hace que disminuya la biodiversidad y afecta a las personas que dependen del río para alimentarse o trabajar.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"cd72a6c4-45dc-4fa8-8fdd-a084296da9f7\"}],\"header\":\"Ejemplo 2: La contaminación de los ríos\"},{\"position\":{\"x\":19.570187558635055,\"y\":59.14966588050314},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>El uso de pesticidas y la pérdida de flores han reducido la cantidad de abejas. Sin abejas, la <strong>polinización disminuye</strong>, lo que afecta el crecimiento de plantas, frutas y cultivos. Esto no solo afecta a la naturaleza, sino también a la producción de alimentos que consumimos todos los días.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"98fd594a-aac4-4a13-accc-6a4478837c51\"}],\"header\":\"Ejemplo 3: Las abejas\"}],\"hotspotNumberLabel\":\"Punto clave #num\",\"closeButtonLabel\":\"Cerrar\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB4AAAAQ4CAIAAABnsVYUAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAE22lUWHRYTUw6Y29tLmFkb2JlLnhtcAAAAAAAPD94cGFja2V0IGJlZ2luPSfvu78nIGlkPSdXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQnPz4KPHg6eG1wbWV0YSB4bWxuczp4PSdhZG9iZTpuczptZXRhLyc+CjxyZGY6UkRGIHhtbG5zOnJkZj0naHR0cDovL3d3dy53My5vcmcvMTk5OS8wMi8yMi1yZGYtc3ludGF4LW5zIyc+CgogPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9JycKICB4bWxuczpBdHRyaWI9J2h0dHA6Ly9ucy5hdHRyaWJ1dGlvbi5jb20vYWRzLzEuMC8nPgogIDxBdHRyaWI6QWRzPgogICA8cmRmOlNlcT4KICAgIDxyZGY6bGkgcmRmOnBhcnNlVHlwZT0nUmVzb3VyY2UnPgogICAgIDxBdHRyaWI6Q3JlYXRlZD4yMDI1LTEyLTEwPC9BdHRyaWI6Q3JlYXRlZD4KICAgICA8QXR0cmliOkV4dElkPmY4MWU0ZTMzLThiOGYtNGYzZi04OTZiLWM5MDM3YzlhNTg4YjwvQXR0cmliOkV4dElkPgogICAgIDxBdHRyaWI6RmJJZD41MjUyNjU5MTQxNzk1ODA8L0F0dHJpYjpGYklkPgogICAgIDxBdHRyaWI6VG91Y2hUeXBlPjI8L0F0dHJpYjpUb3VjaFR5cGU+CiAgICA8L3JkZjpsaT4KICAgPC9yZGY6U2VxPgogIDwvQXR0cmliOkFkcz4KIDwvcmRmOkRlc2NyaXB0aW9uPgoKIDxyZGY6RGVzY3JpcHRpb24gcmRmOmFib3V0PScnCiAgeG1sbnM6ZGM9J2h0dHA6Ly9wdXJsLm9yZy9kYy9lbGVtZW50cy8xLjEvJz4KICA8ZGM6dGl0bGU+CiAgIDxyZGY6QWx0PgogICAgPHJkZjpsaSB4bWw6bGFuZz0neC1kZWZhdWx0Jz5QcmVzZW50YWNpw7NuIC0gOTwvcmRmOmxpPgogICA8L3JkZjpBbHQ+CiAgPC9kYzp0aXRsZT4KIDwvcmRmOkRlc2NyaXB0aW9uPgoKIDxyZGY6RGVzY3JpcHRpb24gcmRmOmFib3V0PScnCiAgeG1sbnM6cGRmPSdodHRwOi8vbnMuYWRvYmUuY29tL3BkZi8xLjMvJz4KICA8cGRmOkF1dGhvcj5DYXJsb3MgR3VhZGFsaW1hPC9wZGY6QXV0aG9yPgogPC9yZGY6RGVzY3JpcHRpb24+CgogPHJkZjpEZXNjcmlw
